
const canvas = document.getElementById('gameCanvas');
const ctx = canvas.getContext('2d');

// Fixed logical resolution
const LOGICAL_WIDTH = 800;
const LOGICAL_HEIGHT = 600;

function resize() {
  const aspect = LOGICAL_WIDTH / LOGICAL_HEIGHT;
  let w = window.innerWidth;
  let h = window.innerHeight;
  
  if (w / h > aspect) {
    w = h * aspect;
  } else {
    h = w / aspect;
  }
  
  canvas.style.width = w + 'px';
  canvas.style.height = h + 'px';
  
  // Center the canvas
  canvas.style.position = 'absolute';
  canvas.style.left = '50%';
  canvas.style.top = '50%';
  canvas.style.transform = 'translate(-50%, -50%)';
  
  canvas.width = LOGICAL_WIDTH;
  canvas.height = LOGICAL_HEIGHT;
}
window.addEventListener('resize', resize);
resize();

const spritesData = [{"id":"ch9lt","name":"1000000346","dataUrl":"data:image/jpeg;base64,"}];
const instancesData = [{"id":"okfyo","spriteId":"ch9lt","x":353.83008356545963,"y":155.7799442896936,"width":50,"height":50},{"id":"xcjkpj","spriteId":"ch9lt","x":1400000,"y":56.61559888579387,"width":50,"height":50},{"id":"1gys0g","spriteId":"ch9lt","x":224.58217270194987,"y":390.8774373259053,"width":50,"height":50},{"id":"sxnd0q","spriteId":"ch9lt","x":724.8607242339833,"y":53.272980501392766,"width":50,"height":50},{"id":"h4u1hv","spriteId":"ch9lt","x":698.1197771587744,"y":371.93593314763234,"width":50,"height":50},{"id":"nl1z4","spriteId":"ch9lt","x":662.4651810584959,"y":535.7242339832869,"width":50,"height":50},{"id":"zibs5y","spriteId":"ch9lt","x":650.2089136490251,"y":395.3342618384401,"width":50,"height":50},{"id":"jd9atyi","spriteId":"ch9lt","x":624.5821727019498,"y":190.32033426183844,"width":50,"height":50},{"id":"j9hqo","spriteId":"ch9lt","x":37400,"y":512.3259052924791,"width":50,"height":50},{"id":"unosg","spriteId":"ch9lt","x":608.9832869080781,"y":519.0111420612814,"width":50,"height":50},{"id":"oogari","spriteId":"ch9lt","x":2380000,"y":176.949860724234,"width":50,"height":50}];
const eventsData = [{"id":"w2hi5m","condition":{"id":"lxt85d","type":"click","targetId":"ch9lt"},"actions":[{"id":"js2wlo","type":"setScale","value":"5","targetId":"ch9lt"},{"id":"2mol7","type":"rotate","value":"100","targetId":"ch9lt"}]}];

const loadedImages = {};
let imagesLoaded = 0;

let instances = instancesData.map(inst => ({
  ...inst,
  rotation: inst.rotation || 0,
  scale: inst.scale || 1,
  opacity: inst.opacity !== undefined ? inst.opacity : 1
}));

// Input state
const input = { x: 0, y: 0, isDown: false, wasDown: false, clicked: false, keys: {}, justPressedKeys: {}, justReleasedKeys: {} };

function updateInputPos(e) {
  const rect = canvas.getBoundingClientRect();
  const scaleX = canvas.width / rect.width;
  const scaleY = canvas.height / rect.height;
  input.x = (e.clientX - rect.left) * scaleX; 
  input.y = (e.clientY - rect.top) * scaleY; 
}

window.addEventListener('pointerdown', e => { 
  updateInputPos(e);
  input.isDown = true; 
  input.clicked = true; 
});
window.addEventListener('pointermove', e => { 
  updateInputPos(e);
});
window.addEventListener('pointerup', e => { input.isDown = false; });
window.addEventListener('keydown', e => { input.keys[e.key] = true; input.justPressedKeys[e.key] = true; });
window.addEventListener('keyup', e => { input.keys[e.key] = false; input.justReleasedKeys[e.key] = true; });

// Timers
const timers = {};
let lastTime = performance.now();
let deltaTime = 0;

function checkCollision(inst1, inst2) {
  const w1 = inst1.width * inst1.scale;
  const h1 = inst1.height * inst1.scale;
  const w2 = inst2.width * inst2.scale;
  const h2 = inst2.height * inst2.scale;
  return inst1.x < inst2.x + w2 &&
         inst1.x + w1 > inst2.x &&
         inst1.y < inst2.y + h2 &&
         inst1.y + h1 > inst2.y;
}

function executeActions(actions, context) {
  for (const action of actions) {
    if (action.type === 'customJs') {
      try {
        const fn = new Function('instances', 'target', 'input', 'ctx', 'canvas', 'deltaTime', action.value || '');
        fn(instances, context.target || context.target1, input, ctx, canvas, deltaTime);
      } catch(e) { console.error("Custom JS Error:", e); }
      continue;
    }
    
    if (action.type === 'spawn') {
      instances.push({
        id: Math.random().toString(36).substring(7),
        spriteId: action.targetId,
        x: Number(action.value) || 0,
        y: Number(action.value2) || 0,
        width: 50, height: 50, rotation: 0, scale: 1, opacity: 1
      });
      continue;
    }

    const targets = action.targetId ? instances.filter(i => i.spriteId === action.targetId) : [];
    for (const target of targets) {
      if (action.type === 'moveX') target.x += Number(action.value) || 0;
      if (action.type === 'moveY') target.y += Number(action.value) || 0;
      if (action.type === 'setX') target.x = Number(action.value) || 0;
      if (action.type === 'setY') target.y = Number(action.value) || 0;
      if (action.type === 'rotate') target.rotation += Number(action.value) || 0;
      if (action.type === 'setScale') target.scale = Number(action.value) || 1;
      if (action.type === 'setOpacity') target.opacity = Number(action.value) || 1;
      if (action.type === 'destroy') {
        instances = instances.filter(i => i !== target);
      }
    }
    if (action.type === 'alert') alert(action.value);
  }
}

function runEvents(type) {
  for (const ev of eventsData) {
    if (ev.condition.type === type) {
      if (type === 'click' || type === 'pointerdown' || type === 'pointerup') {
        const isTriggered = 
          (type === 'click' && input.clicked) || 
          (type === 'pointerdown' && input.isDown && !input.wasDown) || 
          (type === 'pointerup' && !input.isDown && input.wasDown);

        if (isTriggered) {
          if (ev.condition.targetId) {
            const targets = instances.filter(i => i.spriteId === ev.condition.targetId);
            for (const t of targets) {
              const w = t.width * (t.scale || 1);
              const h = t.height * (t.scale || 1);
              // Handle rotation for precise clicking if needed, but AABB is fine for now
              if (input.x >= t.x && input.x <= t.x + w && input.y >= t.y && input.y <= t.y + h) {
                executeActions(ev.actions, { target: t });
              }
            }
          } else {
            executeActions(ev.actions, {});
          }
        }
      } else if (type === 'collision') {
        const targets1 = instances.filter(i => i.spriteId === ev.condition.targetId);
        const targets2 = instances.filter(i => i.spriteId === ev.condition.targetId2);
        for (const t1 of targets1) {
          for (const t2 of targets2) {
            if (checkCollision(t1, t2)) {
              executeActions(ev.actions, { target1: t1, target2: t2 });
            }
          }
        }
      } else if (type === 'keydown') {
        if (input.justPressedKeys[ev.condition.value]) {
          executeActions(ev.actions, {});
        }
      } else if (type === 'keyup') {
        if (input.justReleasedKeys[ev.condition.value]) {
          executeActions(ev.actions, {});
        }
      } else if (type === 'timer') {
        const timerId = ev.id;
        if (!timers[timerId]) timers[timerId] = 0;
        timers[timerId] += deltaTime;
        const interval = (Number(ev.condition.value) || 1) * 1000;
        if (timers[timerId] >= interval) {
          timers[timerId] = 0;
          executeActions(ev.actions, {});
        }
      } else {
        executeActions(ev.actions, {});
      }
    }
  }
}

function init() {
  console.log("Engine started");
  runEvents('start');
  requestAnimationFrame(loop);
}

function loop(time) {
  deltaTime = time - lastTime;
  lastTime = time;
  ctx.clearRect(0, 0, canvas.width, canvas.height);
  
  if (input.isDown && !input.wasDown) runEvents('pointerdown');
  if (!input.isDown && input.wasDown) runEvents('pointerup');
  if (input.clicked) runEvents('click');
  
  runEvents('keydown');
  runEvents('keyup');
  runEvents('update');
  runEvents('timer');
  
  for (const inst of instances) {
    if (loadedImages[inst.spriteId]) {
      ctx.save();
      ctx.globalAlpha = inst.opacity !== undefined ? inst.opacity : 1;
      const scale = inst.scale || 1;
      const width = inst.width * scale;
      const height = inst.height * scale;
      ctx.translate(inst.x + width/2, inst.y + height/2);
      ctx.rotate((inst.rotation || 0) * Math.PI / 180);
      ctx.drawImage(loadedImages[inst.spriteId], -width/2, -height/2, width, height);
      ctx.restore();
    }
  }
  
  input.clicked = false;
  input.wasDown = input.isDown;
  input.justPressedKeys = {};
  input.justReleasedKeys = {};
  requestAnimationFrame(loop);
}

if (spritesData.length === 0) {
  init();
} else {
  for (const sprite of spritesData) {
    const img = new Image();
    img.onload = () => {
      loadedImages[sprite.id] = img;
      imagesLoaded++;
      if (imagesLoaded === spritesData.length) init();
    };
    img.onerror = () => {
      console.error("Failed to load sprite:", sprite.name);
      imagesLoaded++;
      if (imagesLoaded === spritesData.length) init();
    };
    img.src = sprite.dataUrl;
  }
}
  